            amount:'400',
            date: Date(2022,12,2)
        },
        {
            id:'e2',
            title:'Books Fee',
            amount:'500',
            date: Date(2022,12,5)
        },
        {
            id:'e3',
            title:'House rent Fee',
            amount:'700',
            date: Date(2022,12,7)
        },
        {
            id:'e4',
            title:'Foods',
            amount:'540',
            date: Date(2022,12,10)
        }

    ]

   return(
    <div>
        <h2>Let's get Started</h2>
        <ExpenseItem 
            date={expense[0].date} 
            title={expense[0].title} 
            amount={expense[0].amount}>
        </ExpenseItem>
        <ExpenseItem 
            date={expense[1].date} 
            title={expense[1].title} 
            amount={expense[1].amount}>
        </ExpenseItem>
        <ExpenseItem 
            date={expense[2].date} 
            title={expense[0].title} 
            amount={expense[0].amount}>
        </ExpenseItem>
        <ExpenseItem 
            date={expenseDate} 
            title={expenseTitle} 
            amount={expenseAmount}>
        </ExpenseItem>
   </div>
   )
}

export default App;
